import React,{useEffect, useState} from "react";
import Label from "./Label";

export default function Clock({clockState, min, sec}) {

    return (
        <div>
            <Label text={clockState}/>
            <Label text={min}/>
            <Label text={sec}/>
        </div>
    )
}
